INSERT INTO "public"."events" ("id", "title", "description", "location", "start_time", "end_time", "cover_image_url", "is_active", "created_at", "updated_at", "slug", "sale_start_time", "sale_end_time") VALUES
	('b6d2c266-60da-4945-a475-e9d66d274b6f', 'Aki Matsuri 2025', '<p>Red Party</p>', 'Sảnh A4, Sky Expo', '2025-10-26 01:00:00+00', '2025-10-26 12:00:00+00', '', true, '2025-09-05 03:43:56.698909+00', '2025-09-05 03:43:56.698909+00', 'aki-matsuri-2025-924230', '2025-09-01 01:00:00+00', '2025-10-19 17:00:00+00'),
	('36fa42cd-2f24-4980-9c7d-b2ad724ce565', 'Otaku Festival', '<p>Các tình iu ơi! <strong>Pride Month</strong> có thể đã qua nhưng "tinh thần yêu thương" thì không bao giờ hết nha!</p>', 'Trung tâm văn hóa quận 5, Số 105 Trần Hưng Đạo, Q5, TPHCM', '2025-08-31 01:00:00+00', '2025-08-31 12:00:00+00', 'https://wbhvlpufcjognjosttum.supabase.co/storage/v1/object/public/event-images/1755014708988_526560573_1175593614613055_6153972867179821226_n.jpg', false, '2025-07-30 08:53:31.590495+00', '2025-09-05 03:44:07.241614+00', 'otaku-festival-916098', '2025-06-30 17:00:00+00', '2025-08-30 17:00:00+00'),
	('8078d48e-4634-4568-bc05-23038b03ae3d', 'Natsu Matsuri', '<p>Chỉ còn 3 tuần nữa là tới ngày hẹn cùng Lễ Hội Mùa Hè rồi, mọi người chuẩn bị tới đâu rồi nè. kkk</p>', 'Công Viên Phần Mềm, Đ. Số 1/Lô 44 Đ. Quang Trung, Trung Mỹ Tây, Quận 12, Hồ Chí Minh', '2025-07-13 01:00:00+00', '2025-07-13 12:00:00+00', 'https://wbhvlpufcjognjosttum.supabase.co/storage/v1/object/public/event-images/1753923473145_509431975_1027778352879445_8975570633181338092_n.png', false, '2025-07-30 14:45:58.296058+00', '2025-09-07 07:41:36.760721+00', 'natsu-matsuri-474079', NULL, NULL);
INSERT INTO "public"."articles" ("id", "event_id", "title", "content", "image_url", "created_at", "updated_at", "slug", "status") VALUES
	('e5288d83-f07e-43bb-9dcd-2ec79f7d857c', '36fa42cd-2f24-4980-9c7d-b2ad724ce565', 'MỆNH THIÊN HOA', '<p>Không chỉ là một cosplayer kỳ cựu, Mệnh Thiên Hoa còn là một makeup artist tài năng, có thể biến hóa theo nhiều phong cách nhân vật khác nhau, cổ cân đẹp mọi layout luôn đó!</p>', 'https://wbhvlpufcjognjosttum.supabase.co/storage/v1/object/public/event-images/1753923643847_518320986_1163849269120823_4411728628631209886_n%20(1).jpg', '2025-07-31 01:00:43.993021+00', '2025-07-31 01:00:43.993021+00', 'menh-thien-hoa-644243', 'public'),
	('5605576e-0524-4aa1-95fa-81f886533c93', '36fa42cd-2f24-4980-9c7d-b2ad724ce565', 'JIAKI DARKNESS', '<p>Anh chàng cosplayer kiêm Dj siêu ngầu này đã sẵn sàng khuấy động không khí tại Otaku Festival như bão cuốn cấp 9! Lên lịch đi quẩy cùng Jiaki liền các mom ơi~~~</p>', 'https://wbhvlpufcjognjosttum.supabase.co/storage/v1/object/public/event-images/1753948517027_520604579_1164612355711181_290270339352774671_n%20(1).jpg', '2025-07-31 07:55:18.058696+00', '2025-07-31 07:55:18.058696+00', 'jiaki-darkness-517857', 'public'),
	('9233b312-dfeb-4e08-85a7-2b6aeb481bd5', '36fa42cd-2f24-4980-9c7d-b2ad724ce565', 'PINKY NGUYEN', '<p>Tâm bão mang theo visual đỉnh cao, thần thái ngút trời, outfit không chê vào đâu được, không gây mưa nhưng sẽ gây ngất ngây đó, anh chị em sẵn sàng đón bão chưaaaaa?</p>', 'https://wbhvlpufcjognjosttum.supabase.co/storage/v1/object/public/event-images/1753948624403_522089519_1165405045631912_6594048477342062026_n.jpg', '2025-07-31 07:57:05.810528+00', '2025-07-31 10:37:45.213281+00', 'pinky-nguyen-264807', 'public'),
	('1c37afff-3476-46ea-808d-ad311753c404', '36fa42cd-2f24-4980-9c7d-b2ad724ce565', 'YUKI GODBLESS', '<p>Cổ mang theo làn sóng visual cực mạnh, <strong><em>vibe </em></strong>cực cháy và năng lượng bùng nổ~ <strong>Đừng bảo không có ai dắt bạn đi bão nha, bão đang tới rồi nè~~~~</strong></p><p></p>', 'https://wbhvlpufcjognjosttum.supabase.co/storage/v1/object/public/event-images/1753948640607_520167678_1166156455556771_1013805103126513557_n.jpg', '2025-07-31 07:57:21.397156+00', '2025-08-15 14:36:22.808382+00', 'yuki-godbless-641215', 'public');
