	('057a9826-baaa-4365-b633-485068341fb8', 'resend_ticket', '[Orochi] Gửi lại vé sự kiện {{ten_su_kien}}', '<p><strong>Chào {{ten_khach_hang}}</strong>, chúng tôi gửi lại vé sự kiện <strong>{{ten_su_kien}}</strong> theo yêu cầu của bạn</p><p><em>Vui lòng không chia sẻ mã vé cho bất kỳ ai.</em><br>Danh sách vé:<br>{{danh_sach_ve}}</p>', '2025-08-02 05:51:55.660742+00', '2025-08-06 08:14:30.718185+00'),
	('16ee6e30-7b9d-4c62-a877-e2e1b13b7999', 'invitation_ticket', '[Orochi] Thư mời tham dự sự kiện {{ten_su_kien}}', '<p><strong>Chào {{ten_khach_hang}}</strong>, mời bạn đến tham dự sự kiện <strong>{{ten_su_kien}}</strong></p><p><em>Vui lòng không chia sẻ mã vé cho bất kỳ ai.</em><br>Danh sách vé:<br>{{danh_sach_ve}}</p>', '2025-08-02 05:52:06.238433+00', '2025-08-06 08:14:33.633913+00'),
	('79da7d0a-fabf-48f9-8dad-63aebf090676', 'purchase_confirmation', '[Orochi] Mã xác nhận giao dịch sự kiện {{ten_su_kien}}', '<p><strong>Chào {{ten_khach_hang}}</strong>, cảm ơn bạn đã mua vé tham gia sự kiện <strong>{{ten_su_kien}}</strong></p><p><em>Vui lòng không chia sẻ mã vé cho bất kỳ ai.</em><br>Danh sách vé:<br>{{danh_sach_ve}}</p>', '2025-08-02 05:51:33.13368+00', '2025-08-06 08:14:35.80988+00'),
	('b624912f-aff4-4e77-b7f2-15212ab2ee83', 'reset_password', 'Yêu cầu Đặt lại Mật khẩu cho tài khoản Orochi', '<p>Chào {{ten_khach_hang}},</p><p>Chúng tôi đã nhận được yêu cầu đặt lại mật khẩu cho tài khoản của bạn. Vui lòng nhấn vào nút bên dưới để tạo mật khẩu mới. Link này sẽ hết hạn sau một thời gian ngắn.</p><p style="text-align: center; margin: 25px 0;"><a href="{{reset_link}}" style="background-color: #088e8b; color: white; padding: 12px 25px; text-decoration: none; border-radius: 5px; font-size: 16px; font-weight: bold;">Đặt lại Mật khẩu</a></p><p>Nếu bạn không yêu cầu việc này, vui lòng bỏ qua email này.</p>', '2025-08-09 14:55:46.292954+00', '2025-08-09 14:55:46.292954+00');
